UPDATE hauls
SET
    haul_weather_status_id = 1;

ALTER TABLE hauls
ADD COLUMN water_speed DECIMAL,
ADD COLUMN water_direction DECIMAL,
ADD COLUMN salinity DECIMAL,
ADD COLUMN water_temperature DECIMAL,
ADD COLUMN ocean_climate_depth DECIMAL,
ADD COLUMN sea_floor_depth DECIMAL;

CREATE TABLE
    ocean_climate (
        "timestamp" TIMESTAMPTZ NOT NULL,
        "depth" INT NOT NULL,
        latitude DECIMAL NOT NULL,
        longitude DECIMAL NOT NULL,
        water_speed DECIMAL,
        water_direction DECIMAL,
        upward_sea_velocity DECIMAL,
        wind_speed DECIMAL,
        wind_direction DECIMAL,
        salinity DECIMAL,
        temperature DECIMAL,
        sea_floor_depth DECIMAL NOT NULL,
        weather_location_id INT NOT NULL REFERENCES weather_locations (weather_location_id) GENERATED ALWAYS AS (
            ((FLOOR(latitude / 0.1) + 1000) * 100000) + (FLOOR(longitude / 0.1) + 1000)
        ) STORED,
        PRIMARY KEY ("timestamp", "depth", weather_location_id)
    )
PARTITION BY
    RANGE ("timestamp");

CREATE TABLE
    ocean_climate_0 PARTITION OF ocean_climate FOR
VALUES
FROM
    (TO_TIMESTAMP(0)) TO (TO_TIMESTAMP(999999999999));

